import React from 'react';

import {
    Card,
    Form,
    Input,
    Button,
    Table,
    message,
    Popconfirm,
    Space,
} from "antd";
import {
    EditOutlined,
    DeleteOutlined,
    SearchOutlined,
} from "@ant-design/icons";

const NewTemplate = (props) => {
    let formFields = {}
   
    const layout = {
        labelCol: {
        span: 8,
        },
    wrapperCol: {
        span: 16,
        },
    };

    return(
        <Card style={{ width: 500 }}>
        <Form onSubmit={ (e) => { 
            e.preventDefault();
            props.handleFormSubmit(
                formFields.name.value,
                formFields.description.value
            ); 
            e.target.reset();}
            } {...layout} name="nest-messages" >
        <Form.Item
            name=""
            label="Name"
            rules={[
                {
                    required: true,
                },
            ]}
        >
            <Input />
        </Form.Item>
        <Form.Item
        name={['user', 'email']}
        label="Email"
        rules={[
          {
            type: 'email',
          },
        ]}
        >
            <Input />
        </Form.Item>
      
        <Form.Item name={['user', 'introduction']} label="テンプレート内容">
            <Input.TextArea />
        </Form.Item>
        <Form.Item wrapperCol={{ ...layout.wrapperCol, offset: 8 }}>
            <Button type="primary" htmlType="submit">
                Submit
            </Button>
        </Form.Item>
    </Form>
    </Card>
    )
  }
export default NewTemplate;
